import React, { Component } from 'react'
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Moment from 'react-moment';
import Skeleton from '@material-ui/lab/Skeleton';
import NumericLabel from 'react-pretty-numbers'
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import {Row, Col} from 'react-bootstrap';
import { Redirect } from 'react-router-dom';
import { searchData } from '../../store/actions/youtube';


const option = {
    'justification': 'L',
    'locales': 'en-US',
    'currency':false,
    'percentage': false,
    'wholenumber':'ceil',
    'commafy': true,
    'cssClass': ['red'],
    'shortFormat': true,
    'shortFormatMinValue': 10000,
    'title': true
    };


export class List extends Component {
    componentDidMount(){
        let str = this.props.location.search
        if(this.props.location.search){
            this.props.searchData(str.split('=')[1])    
        }else{
            this.props.history.push("/");
        }
    }
    render() {
        return (
            <div className="container">
                <Row>
                    <Col sm={3}>
                    <div style={{ width: '260px', height: '200px' }}>
                        <CardMedia
                        component="img"
                        alt="Contemplative Reptile"
                        height="140"
                        image="https://i.ytimg.com/vi/m9oHpvru4So/hqdefault.jpg"
                        title="Contemplative Reptile"
                        />
                    </div>
                    </Col>
                    <Col sm={9}>
                        <CardContent  style={{ padding: '0' }}>
                            <Typography gutterBottom variant="h6" component="h5">
                                Joan Louji
                            </Typography>
                            <Typography variant="body2" color="textSecondary" component="p">
                            His channel
                            </Typography>
                            <Row>
                                <Col>
                                <Row xs={3}>
                                    <Col xs={1}>
                                        <Typography variant="body2" color="textSecondary" component="p">
                                            <NumericLabel params={option}>1234</NumericLabel> 
                                        </Typography>
                                    </Col>
                                    <Col xs={2}>
                                    <Typography variant="body2" color="textSecondary" component="p">
                                            views
                                        </Typography>
                                    </Col>
                                </Row>

                                </Col>
                                <Col>
                                </Col>
                            </Row>
                        </CardContent>                   
                    </Col>
                </Row>
            </div>
        )
    }
}

const mapStateToProps = (state) => ({
    data: state.youtube
  });

export default connect(mapStateToProps,{searchData})(List);
